#include <Stepper.h>
#define LDR A0
int randNumber;
int pos = 0;
const int stepsPerRevolution = 127;
Stepper myStepper1(stepsPerRevolution, 0, 1, 2, 3);
Stepper myStepper2(stepsPerRevolution, 4, 5, 6, 7);
void setup() {
  myStepper1.setSpeed(120);
  myStepper2.setSpeed(120);
  pinMode(LDR, INPUT);
  Serial.begin(9600);
}
void loop() {
  if (analogRead(LDR) > 10) {
  randNumber = random(0,3);
