   }
   
   elapsed_time4min = elapsed_time4sec = millis();
   nSec = int((elapsed_time4min - start_time4min) / 1000);
   // remise Ã  zÃ©ro du comptage sur la minute
   if ((elapsed_time4min - start_time4min) > 60000) {
      start_time4min = elapsed_time4min;
